class HomePageNewComponent {
    constructor(userAuthService, overlaySpinnerService, route, router, ngZone, api, cardsService, mixpanelService) {
        this.userAuthService = userAuthService;
        this.overlaySpinnerService = overlaySpinnerService;
        this.route = route;
        this.router = router;
        this.ngZone = ngZone;
        this.api = api;
        this.cardsService = cardsService;
        this.mixpanelService = mixpanelService;
    }
    ngOnInit() {
        console.log('home page ngOnInit!');
        this.route.fragment.subscribe(fragment => { this.scrollTo(fragment); });
        this.route.queryParams.subscribe(params => {
            const refId = params['ref'];
            console.log('refId:', refId);
            if (refId) {
                localStorage.setItem('refId', refId);
                console.log('refId ID stored:', refId);
            }
        });
        // track events
        this.mixpanelService.track("PageViewed", { 'Page Title': 'home-page' });
        this.userAuthService.userDataEmmiter.subscribe((userData) => {
            this.userData = userData;
            userData ? this.overlaySpinnerService.changeOverlaySpinner(false) : null;
            // this.ngZone.run(() => this.router.navigate(['all-packs-page']));
        });
        this.userData = this.userAuthService.userData;
    }
    scrollTo(id) {
        const element = document.querySelector("#" + id);
        if (element)
            element.scrollIntoView();
    }
}
