        _angular_core__WEBPACK_IMPORTED_MODULE_1__["text"](560, "\u05D0\u05D9\u05DF \u05DC\u05D4\u05E4\u05E2\u05D9\u05DC \u05D0\u05D5 \u05DC\u05D0\u05E4\u05E9\u05E8 \u05DC\u05D4\u05E4\u05E2\u05D9\u05DC \u05DB\u05DC \u05D9\u05D9\u05E9\u05D5\u05DD \u05DE\u05D7\u05E9\u05D1 \u05D0\u05D5 \u05DB\u05DC \u05D0\u05DE\u05E6\u05E2\u05D9 \u05D0\u05D7\u05E8, \u05DC\u05E8\u05D1\u05D5\u05EA \u05EA\u05D5\u05DB\u05E0\u05D5\u05EA \u05DE\u05E1\u05D5\u05D2 \u00A0");
